def no_duplicates(f):
    def wrap_remove_duplicates():
        policies = f()
        return remove_duplicates(policies)

    return wrap_remove_duplicates


def remove_duplicates(policies):
    s = set()
    new_policies = []
    for ops in policies:
        key = []
        for op in ops:
            key.append(op[0])
        key = '_'.join(key)
        if key in s:
            continue
        else:
            s.add(key)
            new_policies.append(ops)

